            "description": "Target Audience\nPersonnel who want to become data communication engineers\nPersonnel who want to obtain HCIA-R&S certification\nPrerequisites\nï¬\tBe familiar with PC operations..\nï¬\tHave a basic understanding of IT technologies and network knowledge..\nObjectives\nOn completion of this program, the participants will be able to:\nï¬\tDescribe the basic principles of data communication and be competent for basic O&M of IP networks.\nï¬\tPlan and design IP addresses.\nï¬\tPerforming Basic VRP Operations\nï¬\tDescribe the functions and working principles of the switching equipment.\nï¬\tSet up an efficient switching network by configuring switching devices and running the STP/RSTP protocol.\nï¬\tDescribe the basic principles of routing and routing protocols. Configure RIP/OSPF to build an efficient enterprise routing network.\nï¬\tConfigure common services on enterprise networks, such as DHCP, FTP, and Telnet, so that enterprises can efficiently use and manage the network.\nï¬\tSet up a small-scale enterprise network.\nï¬\tConfigure link aggregation, VLAN, and GVRP to enhance the performance of enterprise Layer two networks.\nï¬\tConfigure HDLC, PPP, PPPoE, or FR on the serial link to implement WAN interconnection.\nï¬\tPerforming NAT Configuration\nï¬\tConfiguring the Enterprise Network to Access the 3G Network\nï¬\tConfigure ACL, AAA, and IPSec/GRE to provide security solutions for enterprise IP networks.\nï¬\tConfigure SNMP and eSight to manage enterprise networks in a unified manner.\nï¬\tBuild a network that meets enterprise service requirements.\nTraining Contents\nHCIA-R&S Entry\nï¬\tBasic Knowledge of TCP/IP\nï®\tBasic Enterprise Network Architecture\nï®\tIntroduction to Transmission Media\nï®\tEthernet framing\nï®\tIP addressing\nï®\tICMP protocol\nï®\tARP protocol\nï®\tTransport layer protocol\nï®\tData forwarding Scenario\nï¬\tIntroduction to the VRP\nï®\tVRP Foundation\nï®\tNavigating the CLI\nï®\tFile System Navigation and Management\nï®\tVRP Operating system Image management\nï¬\tIntroduction to Switching Technologies\nï®\tEstablishing a Single Switched Network\nï®\tSpanning Tree Protocol\nï®\tRapid Spanning Tree Protocol\nï¬\tIntroduction to Routing Technologies\nï®\tBasic Knowledge of IP Routing\nï®\tIP Static Route\nï®\tDistance Vector Routing with RIP\nï®\tLink State Routing with OSPF\nï¬\tIntroduction to IP Services\nï®\tDHCP Protocol Principles\nï®\tFTP Protocol Principles\nï®\tTelnet Protocol Principles\nHCIA-R&S Intermediate\nï¬\tAdvanced switching technologies\nï®\tAdvanced Enterprise Network Solution Overview\nï®\tLink aggregation\nï®\tVLAN Principle\nï®\tGARP and GVRP\nï®\tVLAN Routing\nï®\tWireless LAN Overview\nï¬\tIntroduction to WAN Technologies\nï®\tPrinciples and Configuration of HDLC and PPP\nï®\tFrame Relay Principles\nï®\tPrinciples and Configuration of PPPoE\nï¬\tIntroduction to Access Control\nï®\tEstablishing Enterprise RAN Solution\nï®\tNetwork address translation\nï®\tAccess control list\nï®\tAAA\nï®\tSecuring Data with IPSec VPN\nï®\tGeneric Routing Encapsulation\nï¬\tIntroduction to Network Management\nï®\tSimple Network Manangement Protocol\nï®\teSight Network Management Solution\nï¬\tIntroduction to IPv6\nï®\tIntroducing IPv6 Networks\nï®\tIPv6 Routing Technologies\nï®\tIpv6 Application Service - DHCPv6\nDuration\n10 working days\nClass Size\nMax 12",
